package_notes:
Este conjunto de dados reúne arquivos, modelos, documentos técnicos e links relacionados à Engenharia Digital e à Modelagem da Informação da Construção (BIM) no âmbito da ARTESP. Ele foi criado para oferecer acesso público a informações, padrões, especificações e materiais técnicos que apoiam o planejamento, o projeto, a operação e a manutenção de empreendimentos de transporte sob regulação da agência.

Os dados pode incluir:
Modelos BIM (arquivos em formatos IFC, RVT, DWG, entre outros);
Documentação técnica (normas, guias, manuais e procedimentos);
Especificações e requisitos técnicos para projetos digitais;
Links para recursos externos (repositórios, catálogos, bibliotecas BIM);
Relatórios, estudos e levantamentos técnicos associados à implantação do BIM na ARTESP.

Este conjunto de dados visa:
Promover a transparência e o compartilhamento de informações sobre engenharia digital e BIM;
Apoiar projetistas, concessionárias, consultores e pesquisadores no acesso a dados técnicos padronizados;
Facilitar a interoperabilidade entre sistemas, softwares e agentes públicos ou privados envolvidos nos empreendimentos.

